import React from "react";
import "./Frame3.css";

function Frame3(props) {
  const { leavePage, className } = props;

  return (
    <div className={`frame-32 ${className || ""}`}>
      <div className="leave-page valign-text-middle ibmplexsans-semi-bold-quarter-spanish-white-16px">{leavePage}</div>
    </div>
  );
}

export default Frame3;
